import React from 'react'
import './Message.css'

function Message({ user, userImage, timestamp , message}) {
    return (
      <div className='message'>
        <img src={userImage} alt='' />
        <div className='message__info'>
          <h4>
            {user} {'  '} <span></span>
          </h4>
          <p>{message}</p>
        </div>
      </div>
    );
}

export default Message
